package com.god.dragon.utils.common;

import com.google.zxing.BarcodeFormat;
import com.google.zxing.EncodeHintType;
import com.google.zxing.MultiFormatWriter;
import com.google.zxing.common.BitMatrix;
import com.google.zxing.qrcode.decoder.ErrorCorrectionLevel;

import javax.imageio.ImageIO;
import java.awt.*;
import java.awt.image.BufferedImage;
import java.io.ByteArrayInputStream;
import java.io.ByteArrayOutputStream;
import java.util.Base64;
import java.util.HashMap;
import java.util.Map;

/**
 * @author wuyuxiang
 * @version 1.0.0
 * @package com.god.dragon.utils.common
 * @date 2023/6/7 15:00
 * 二维码生成工具
 */
public class QrCodeGenerator {
    private static final int CODE_WIDTH = 400; //二维码的宽度像素
    private static final int CODE_HEIGHT = 400; //二维码的高度像素
    private static final int FRONT_COLOR = 0x000000; //二维码的前景色(黑色)
    private static final int BACKGROUND_COLOR = 0xFFFFFF; //二维码的背景色(白色）

    /**
     * 生成二维码
     * @param content 二维码内容一般是网站url
     * @return 图片Base64String
     */
    public static String createQrCode(String content,String logoImageBase64){

        Map<EncodeHintType, Object> hints = new HashMap(); //设置二维码参数
        hints.put(EncodeHintType.CHARACTER_SET, "UTF-8"); //设置字符编码
        hints.put(EncodeHintType.ERROR_CORRECTION, ErrorCorrectionLevel.M); //二维码误差等级
        hints.put(EncodeHintType.MARGIN, 1);//设置二维码边距,单位像素,值越小,二维码距离四周越近

        try (
            ByteArrayOutputStream bos = new ByteArrayOutputStream();
            ByteArrayInputStream bis = new ByteArrayInputStream(Base64.getDecoder().decode(logoImageBase64))
        ){
            //二维码生成器,返回的BitMatrix就是二维码的二维矩阵
            MultiFormatWriter multiFormatWriter = new MultiFormatWriter();
            BitMatrix bitMatrix = multiFormatWriter.encode(content, BarcodeFormat.QR_CODE, CODE_WIDTH, CODE_HEIGHT, hints);

            //jwt绘图工具进行绘图
            BufferedImage bufferedImage = new BufferedImage(bitMatrix.getWidth(), bitMatrix.getHeight(), BufferedImage.TYPE_INT_BGR);
            for (int x = 0; x < bitMatrix.getWidth(); x++) {
                for (int y = 0; y < bitMatrix.getHeight(); y++) {
                    bufferedImage.setRGB(x, y, bitMatrix.get(x, y) ? FRONT_COLOR : BACKGROUND_COLOR);
                }
            }

            //绘制Logo
            Graphics2D graphics = bufferedImage.createGraphics();
            int logoWidth = bitMatrix.getWidth() / 4,logoHeight = bitMatrix.getHeight()/4;
            int locationX = (bitMatrix.getWidth()-logoWidth) / 2,locationY = (bitMatrix.getHeight()-logoHeight) / 2;
            BufferedImage logo = ImageIO.read(bis);
            graphics.drawImage(logo,locationX,locationY,logoWidth,logoHeight,null);
            graphics.dispose();

            ImageIO.write(bufferedImage,"png",bos);
            return Base64.getEncoder().encodeToString(bos.toByteArray());
        }catch (Exception e) {
            throw new RuntimeException(e.getMessage(),e);
        }
    }

    public static void main(String[] args) {
//        System.out.println(createQrCode("http://www.google.com",""));
    }
}
